import React from 'react'

const Testimonials = () => {
  return (
    <div className=' bg-[url("https://source.unsplash.com/1600x800/?dark")] '>
        <div className="text-bold text-[320%] text-white">What our clients say</div>
        <div className="bg-transparent text-w"></div>
    </div>
  )
}

export default Testimonials
